package loops;

public class EnhancedFor {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		// guess, used only in arrays
		int x[] = { 83, 92, 1, 2, 54 };
		String y[] = { "abns", "jhkjh", "dhsj", "mkvhsh" };

		for (int p : x) {
			System.out.println(p);
		}
		
		for (String q : y) {
			System.out.println(q);
		}

	}

}
